import { Modal, Row, Container, Col, Button, Form } from "react-bootstrap";
import * as Icon from "react-bootstrap-icons";
import fifa from "../img/fifa23.jpg";

import { Link } from "react-router-dom";
import { useState, useEffect } from "react";
const TournamentOverview = ({ visible, onhide }) => {
  return (
    <Container fluid>
      <h3>OverView</h3>
      <Row className="mx-auto w-100  mb-5">
        <Col>
          <Row>
            <Col>
              <div className="d-flex  ">
                <img className="tournament-name-img" src={fifa} alt="" />
                <div className="d-flex flex-column">
                  <span className="d-flex ml-2">Name Of Tournament</span>{" "}
                  <span className="d-flex ml-2">FIFA 23</span>{" "}
                </div>
              </div>
            </Col>
          </Row>
        </Col>
      </Row>

      <Row className="my-5 ">
        <div className="ml-auto">
          <Button onClick={onhide} variant="outline-primary">
            Cancel
          </Button>
          <Button className="primary-btn ml-3 textColor">
            <Icon.Plus size={30} />
            Create
          </Button>
        </div>
      </Row>
    </Container>
  );
};
export default TournamentOverview;
